function Input() {
    return (
        <div className="InputText">
            <div class="col-md-6">
                <div class="form-group">
                    <outputLabel value="N° do IPTU" for="numeroIptuInputText"
                    />
                    <inputText id="numeroIptuInputText"
                        value="#{managerCadastroGeral.imovel.numeroIptu}"
                        placeholder="Número" styleClass="form-control"

                    />

                </div>
            </div>
        </div>
    );
}

export default Input;
